import React from 'react';
import './Footer'

const Footer = () => {
  return (
    <div className='footer'>
      <div className='footerSection_01'>
        <div className='aboutPlus__social-media'></div>
        <div className='onlineShopping'></div>
        <div className='customerPolicy'></div>
        <div className='storeInformation'></div>
      </div>
      {/* <div className='footerSection_02'></div> */}

    </div>
  )
}

export default Footer;
